script: |
  super -f text -I q9741.spq | sort > q9741.out

inputs:
  - name: q9741.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( NOT NULL NOT IN ( col0 + col1 ) ) AND NOT ( NULL ) <= NULL OR col1 NOT BETWEEN - col2 * col2 + - col0 * + col1 AND NULL;
  - name: tab2

outputs:
  - name: q9741.out
    data: |
